		html.id = 'name_txt';
		html.style.left = '438px';
		html.style.top = '452px';
		html.style.width = '384px'; 
		html.style.height = '106px';
		html.style.backgroundColor = 'rgba(255,255,255,1)';
		html.style.border = '1px solid rgba(255,255,255,1)';
		html.style.position = "absolute";
		html.style.boxSizing = "border-box";
		html.style.fontSize = "89pt" 
		
		// Add Input Field to HTML document
		document.body.appendChild(html);
		
		// Add Input Field to Animate CC document
		var gg = new createjs.DOMElement(html);
		document.getElementById("name_txt").maxLength = "3";
		stage.addChild(gg);
		
		var xhttp = new XMLHttpRequest();
		
		this.enter_btn.addEventListener("click", enterName.bind(this))
